export function ServiceItem({ name, isLast }) {
  return (
    <li className="w-full">
      <div className={`flex relative justify-between items-center px-4 py-7 w-full ${isLast ? '' : 'border-b border-solid'} max-sm:px-3 max-sm:py-5`}>
        <span className="z-0">{name}</span>
      </div>
    </li>
  );
}
